		"id_str": "779793043507453952",
		"in_reply_to_user_id": 3255599052,
		"text": "문제 의식이란 게 때로는 문제가 아닌 것조차 문제로 보게 되는 위험성을 내포하고 있기도 합니다만... 그렇다고 없으면 아예 인식하질 못하는 법이니까요.",
		"id": 779793043507454000,
