		"text": "\"어떤 의미에서 그것은 사진이 나왔을 때 회화에서 일어난 것과 닮았습니다. / 그때까지의 회화는 사실 사진과 같은 원리(카메라 옵스큐라)에 의한 것이었습니다. 기하학적 원근법은 그것에 기초하고 있습니다. 그러나 사진이 등장하자 이제 의미가 없게 되었\"",
