		"in_reply_to_user_id": 3255599052,
		"text": "\"영화가 출현하기 전까지 소설가는 이를테면 영화 같은 소설을 쓰려고 정말 많은 궁리를 했습니다. 그러나 일단 영화하는 기술이 출현하자 그 같은 궁리를 무의미하게 되었습니다.\" - 근대문학의 종언 p.58",
