		"text": "가라타니의 기원론과 종언론은 사실 맞물리지 않는 면이 있어요. 전자가 앞으로도 연속될 근대성을 논의한 것이고, 때문에 《상상의 공동체》와 함께 읽히는 것이었다면 후자는 매체(철학)적이며 단절이 예기되는 국소적/지역적 논의라서요.",
