		"id_str": "777051486169640960",
		"in_reply_to_user_id": 3255599052,
		"text": "누구의 논설이 더 타당한가? 저는 가라타니의 손을 들어주고 싶네요. 이글턴이 지적했듯이 모더니즘, 포스트모더니즘 등에 의한 산발적인 저항이 있었지만 언제나 승리해온 것은 근대성을 모태로 하는 리얼리즘이었고 곧 다시 포섭되는 운명을 맞이해왔으니까요.",
