		"geo": {},
		"id_str": "777049074830745601",
		"in_reply_to_user_id": 3255599052,
		"text": "찾고 있어요. 반대로 동일한 연구주제임에도 다른 시각을 보이는 것이 푸코의 논의를 받아 19세기 초중반부터 이전 시대와 근대의 '단절'이 일어났다고 보며 논을 펼친 매체철학자 크래리. 그래서 퍼스펙티브나 내면 등에 대한 얘기가 서로 다르게 돼요.",
		"id": 777049074830745600,
