		"id_str": "777047037644648448",
		"in_reply_to_user_id": 3255599052,
		"text": "물론 서구의 여러 국가들도 시기가 빨랐을 뿐이지 이탈리아 르네상스에서 시작된 근대성이 전이-이식된 것이란 점에선 같다고 할 수 있겠죠. 가라타니는 그래서 근대의 기원을 《신곡》 및 《속어론》에 의하여 언문일치가 이뤄진 14세기 이탈리아까지 소급하여",
