		"text": "RT @kirima_bot: 자기가 하고 있는 일에 의심을 품지 마라.\n설령 의미도 알 수 없고 하는 보람이 없는 일로 보인다 할지라도,\n실제로 바로 그/대/로/라는 사실에 직면하는 것보단 나은 법이다.",
