		"geo": {},
		"id_str": "776050226100514818",
		"text": "이야기에 있어 오타쿠컬쳐의 작품은 주식이 아닌 디저트가 되어버렸는데, 딱히 제가 변했다기보다 스마트폰 보급이라는 환경의 변화가 추동한 바가 크네요. 종이책은 따로 몰입을 위한 주변 환경을 꾸려야 하다보니. 디저트가 제일 좋은 건 여전하지만요.",
		"id": 776050226100514800,
