		"text": "하여간 정신연령이 너무 낮고 문명사회에 진입 못한 수준이라 별로 언급하고 싶지가 않아요... 문명에 적응하지 못한 야만을 그 자체로 체현하는 분들.\n\n아니, 저는 문명 위에서 야만을 다시 평가해야 한다는 입장이지만서도.",
