		"text": "RT @eagletonbot: 어떤 면에서 보면 리얼리즘을 향한 모더니스트들의 공격은 실패했다. 1930년대경 리얼리즘은 다시금 세력을 장악했다. 1960~70년대에는 새로운 문화이론이 리얼리즘을 제거하고자 모더니즘 예술에 도움을 청하며 또 한차례…",
