		"id_str": "775108481447628801",
		"text": "RT @eagletonbot: 새로운 운동들은 줄곧 리얼리즘을 무너뜨리고 싶어 했다. 그러나 예술이나 사상 분야에서 새로운 운동들이 보여준 실험은 어느 정도 여전히 리얼리즘에 의존했다. 입체주의적이지 않은 회화에 익숙하지 않았다면 우리는 입체주의 회…",
