			"text": "그리고 이 사실이야말로 리얼리즘이 적어도 서구 정신의 깊은 뿌리 중 하나라는 것을 말해준다. 우리가 우리 스스로를 인식할 수 있는 세계를 반영하는 예술, 그런 예술이 가치가 있는 것이었다. 도대체 왜 이런 사고방식이 가치 있는지는 대답하기가 어렵다.",
