		"id_str": "775108369778561025",
		"text": "RT @eagletonbot: 1960~70년대의 문화와 마찬가지로 모더니즘 역시 기성의 문화제도에서는 당연히 리얼리즘이 지배적이라고 여겼다. 실제로 리얼리즘은 모든 경쟁자들을 무찌르면서 서구 역사상 가장 탄력적인 문화형식임을 스스로 입증해왔다.",
