		"geo": {},
		"id_str": "775099429728555008",
		"text": "임근준의 21세기에 벤야민을 꺼내드는 건 지적 태만이라 일침을 놓았을 때는 거기에 동의했었는데, 돌아가는 모양새를 보니까 먼지를 털어내고 다시 집어들 필요가 있어보이네요. 기술 발전에 따라 사건이 반복되지만 더 심화되고 있음에.",
		"id": 775099429728555000,
