		"geo": {},
		"id_str": "775094059014598656",
		"in_reply_to_user_id": 3255599052,
		"text": "\"영화 배우의 연기는 하나의 통일된 작업이 아니라, 여러 개의 개별적인 작업이 합쳐져서 이루어진 것이다….부차적인 고려 말고도, 연기자의 연기를 일련의 조립할 수 있는 에피소드로 쪼개어놓을 수밖에 없는 기계장치의 기본적인 필연성들도 작용한다.\"",
		"id": 775094059014598700,
		"in_reply_to_status_id": 775093936264142800,
