		"text": "\"1932년 루돌프 아른하임은 “영화 최근 발전을 보면 배우를 마치 선별적으로 골라서….적당한 장소에 배치하는 소도구처럼 다루고 있다\"고 말하고 있다. 이러한 발언 속에는 이와는 좀 다른 문제가 밀접하게 관련을 맺고 있다.\"",
