		"text": "‘살아라.’ 삶이 동물의 유일한 목적이니 차此 목적을 달하기 위하여는 도덕도 무無하고 시비是非도 무無하니라. 기아飢餓하여 사死에 빈瀕하거든 타인의 것을 약탈함이 어찌 악이리오. 자기가 사死함으로는 녕寧히 타인이 사死함이 정당하니라.",
