		"text": "사실 좋은 비판에 자주 보이고 또 좋아하는 구도가 양측 진영이 이론적으로 상대 진영을 질타하고 있을 때 제3자가 쓰윽 등장해서 '이 사람들아, 사실은 둘 다 이러이러해서 잘못됐고, 그동안의 공박은 헛손질이라네'라고 말하는 거네요. (...",
