		"text": "낭만주의는 어떠하다, 파시즘은 어떠하다, 이러한 진술은 허용이 되면서 어째서 페미니즘에 한하여 불가능하단 건지 전혀 모르겠어요. 동의하지 못할 부분이 있다면 그에 대해서 반박하면 되지, 하나도 빼지 말고 완벽하게 통달해라. 이게 말이 되나요.",
