		"text": "무엇보다, 이론과 가까운 건 질적 방법론이고 귀납이에요. 제가 양적 연구에 종종 회의적인 반응을 나타낸 것도 연역을 위해 그 '전제'가 되는 이론에 소홀해지는 것은 아닌가 해서 그런 것이고요. 다들 그쪽으로 쏠리니.",
