		"text": "분류하는 것은 연역이지만, 그 '분류 틀'을 만들어내는 것은? 귀납을 통한 일반화에 의해 수행되는 거네요. 그리고 그 분류 틀에 대해 끊임없이 자신의 맥락에서 비판하고 수정하는 작업이 이뤄지는 것이 인문학 이론이고.",
