		"text": "말씀하신 건 저도 모두 알고 동의하는 바지만, 기원이니 결절점이니 하는 것들도 결국 적절한 표본조사를 위한 샘플링이고 여기에는 자의성이 개입해요. 모두 검토하는 건 불가능한 일이죠.",
