		"text": "무엇보다 트위터에서 자주 보이는 '학부생 수준 운운'이 버튼(&lt;-사어)을 눌렀네요. 아니, 흔하게 보이는 중2병에서 고2병으로 진화한 양상도 아니고 대학병에서 대학원병으로 진화한 건가... 이 정도면 헤이트 스피치 아니에요? (...",
