		"id_str": "774162089057202176",
		"text": "아무튼 강신주 씨의 발언에 대해 여성철학자 명단을 늘어놓으며 특수성을 부각하는 동시에 그 특수성으로 새로운 당파를 꾸리는 건 이해하겠는데, 저런 식으로 특수성을 극단적으로 강조하는 건 강신주 씨가 아니라 본인의 학문에 대한 몰이해를 드러내는 거예요.",
