		"geo": {},
		"id_str": "774157277875974145",
		"in_reply_to_user_id": 3255599052,
		"text": "그렇게 해서 만들어진 권위만이 인문학의 객관성을 보장한다고 할 수 있겠는데, 또 한편으로는 그 이론이 최종적이거나 자기 완결적이라 더는 '연구할 거리'가 없는 경우는 이러한 추인을 받기 어렵기도 해서...",
		"id": 774157277875974100,
		"in_reply_to_status_id": 774156181904367600,
		"created_at": "2016-09-09 08:07:32 +0000",
		"in_reply_to_screen_name": "EmptyKnK",
		"in_reply_to_user_id_str": "3255599052",
