		"geo": {},
		"id_str": "774156181904367616",
		"in_reply_to_user_id": 3255599052,
		"text": "납득 가능한 선 &lt;&lt; 이게 진짜 어렵네요. 샘플링은 최종적으로 자의적으로 될 수밖에 없고, 때문에 자의성을 넘어서서 널리 받아들여져 담론을 형성하는 것으로만이 그 이론의 타당성을 추인하는 구조라.",
		"id": 774156181904367600,
