		"geo": {},
		"id_str": "774150901158162433",
		"in_reply_to_user_id": 3255599052,
		"text": "사실 강신주의 인터뷰를 읽으면서 약간 내적 정합성이 떨어진다고 생각란 게 이 지점인데, 객관적 퍼스펙티브를 부정하면서 페미니즘 일반을 싸잡는다는 건 하나의 (객관적) 시점으로 사상을 구성하는 것이라... 일반화를 비판하며 본인도 일반화를 하는 거죠.",
