			"text": "철학을 하는 사람이라면 현상학이라고 분류하는 이론들조차 각기 주목하는 바가 다르고 전제하는 바가 달라서 '현상학 전체' 라고 지칭할 수 없다는 것을 안다. 혹여 현상학 전체를 비판하고자 한다면, 현상학에 해당하는 모든 이론의 전제를 모두 검토해야 한다",
