		"in_reply_to_user_id": 3255599052,
		"text": "어떤 사조로 자신이 분류된다는 것에 반발한 사람도 많았지만 그 반발이 곧이곧대로 수용되었던 것도 아니고, 애당초 개별 케이스를 모두 따져야 론이 성립한다면 거의 모든 인문학의 성과를 모두 부정하는 거예요.",
