		"geo": {},
		"id_str": "774149135859462146",
		"text": "비판의 요지에는 동의하지만 사조를 비판하기 위해 모든 이론을 검토 &lt;&lt; 이건 좀 아닌 거 같아요. 이론가 본인의 의향이 있든 없든 어떤 사조로 묶인다는 것부터가 전체적인 흐름을 읽어내고 비판하는 과정인 동시에 결과물 아닌가요.",
