		"geo": {},
		"id_str": "774134497365209088",
		"in_reply_to_user_id": 3255599052,
		"text": "마찬가지로 데포르메되는 모에풍 캐릭터를 그리는 사람에게 인체에 대한 기초를 강조해도 물음표예요. 대체 기초가 뭐기에? 일단 그 기초가 어떻게 설정된 것인가 의문을 던져볼 필요가 있지 않을까요.",
