		"in_reply_to_user_id": 3255599052,
		"text": "수치심이 없는 사람만이 다작을 할 수 있다고 생각해요. 완벽주의는 수치심에서 태어나고, 그 수치심은 높은 체면, 또는 에고에서 비롯되겠죠. 이렇게 보면 확실히 내면성과 자의식이 관련이 있긴 있어요.",
