		"text": "자신 같은 '조빱'도 할 수 있는 것이 주관적인 계보의 작성이라 말하는 것으로 강신주의 작업을 폄하하려고 하는데, 계보의 작성 자체가 대수라기보다 그에 선행하는 강신주의 '비판적 인식'에 중점을 놓고 평가해야 할 부분이거든요.",
