		"text": "그런데 위근우 씨의 강신주에 대한 비판이 합당한지는 모르겠네요. '비겁하다'는 강신주의 발언은 미묘하지만 객관주의에 대한 그의 지적은 기원(소실점)이 존재하는 투명한 퍼스펙티브를 지적하는 바, 곱씹어볼 만한 이야기죠.",
