		"geo": {},
		"id_str": "773904326209044480",
		"in_reply_to_user_id": 3255599052,
		"text": "오오츠카는 '나(주인공&amp;화자)=캐릭터' 정도로 진술했겠지만... 사실 그러면 (언급은 되지 않았지만 가라타니의 저술하에 성립하는 저작으로써) 논거, 혹은 전제가 파탄할 수 있거든요.",
		"id": 773904326209044500,
		"in_reply_to_status_id": 773897246270066700,
		"created_at": "2016-09-08 15:22:24 +0000",
		"in_reply_to_screen_name": "EmptyKnK",
		"in_reply_to_user_id_str": "3255599052",
