		"geo": {},
		"id_str": "773897246270066688",
		"in_reply_to_user_id": 3255599052,
		"text": "오오츠카도 문제가 있었어요. 사소설의 &lt;나&gt; 역시 캐릭터였다는 결론으로 책을 마무리하는데, '나(주인공)=화자=작가'라는 등식에서 '나=캐릭터'로 치환할 때 문제가 생기거든요. '주인공=캐릭터'란 건가, '화자=캐릭터'란 건가 알 수가 없죠.",
		"id": 773897246270066700,
		"in_reply_to_status_id": 773889334139162600,
		"created_at": "2016-09-08 14:54:16 +0000",
		"in_reply_to_screen_name": "EmptyKnK",
