		"geo": {},
		"id_str": "773889334139162624",
		"in_reply_to_user_id": 3255599052,
		"text": "예전부터 가라타니는 독해할 때와 오오츠카를 독해할 때 이 지점이 충돌해서 미심쩍었는데, 드디어 해명해내서 좋네요(정확히는, 미심쩍었지만 어느 지점인지 포착을 못하고 있었어요). 독자적인 론을 세운 뒤에야 어디가 문제였는지 눈에 들어오네요.",
		"id": 773889334139162600,
