		"id_str": "773886995286233088",
		"in_reply_to_user_id": 3255599052,
		"text": "1인칭에선 '주인공이 곧 화자'니까 다룰 수가 없던 거죠. 그리고 여기서 가라타니가 '내면의 변용' 같은 실증 불가능한 주장을 할 수 있던 전제가 드러나는데, 3인칭에서는 '화자가 곧 작자'인 이상 화법의 변용이 그 증거가 된다고 여겨지기 때문이에요.",
