		"id_str": "773885690719318018",
		"text": "몇 번째일지 모르겠는 《일본근대문학의 기원》 재독. 이제서야 눈치 챘는데, 가라타니가 3인칭만을 강조하고 1인칭에 대해선 별다른 언급이 없는 건 주인공/화자(작자) 개념의 한계로 인했던 것이네요.\nhttps://t.co/ONNPvVSH4r",
