		"geo": {},
		"id_str": "772821762568433665",
		"in_reply_to_user_id": 3255599052,
		"text": "이상에야, 노오력으로 자원 없음을 극복하라고 외쳐봤자 공염불이네요. 애초에 노력할 자원이 없는걸요. 거기에 감정으로 부딪히지 말고 그저 건조하게, 부정할 수 없는 정의를 말해야지 안 그러면 어느 쪽이나 피곤해서 탈력하고 말아요.",
