		"text": "작법서에 좋은 조언이 많지만 막상 읽고 나면 쓸모가 없다는 지적이 많은 것도 기법을 단순히 열거하고만 있기 때문이에요. 적어도 현재의 인간에게는 세계를 이해하기 위해서 기반이 되는 모델이 필요하다는 것.",
